  false,\n\t\"url\": null,\n\t\"notes\": \"This report presents the results of laboratory
  testing and stability analyses conducted for Dorris Dam located within the Modoc
  National Wildlife Refuge, Modoc County, California. The stability analyses included
  seepage, static slope stability, and dynamic deformation evaluation. The laboratory
  tests were conducted on soil samples collected during the previous field investigation
  task. Basic classification and index property tests as well as shear strength and
  pinhole dispersion tests were made on the embankment and foundation soils.\",\n\t\"license_title\":
